query:
mutation policyRemotePortFwdCreatePolicyRevision ( $accountId:ID! $remotePortFwdPolicyMutationInput:RemotePortFwdPolicyMutationInput $policyCreateRevisionInput:PolicyCreateRevisionInput!) {
	policy ( accountId:$accountId ) {
		remotePortFwd ( input:$remotePortFwdPolicyMutationInput  )  {
			createPolicyRevision ( input:$policyCreateRevisionInput   ) {
				policy {
					enabled
					rules {
						audit {
							updatedTime
							updatedBy
						}
						rule {
							id
							name
							description
							index
							section {
								id
								name
							}
							enabled
							forwardIcmp
							externalIp {
								id
								name
							}
							externalPortRange {
								from
								to
							}
							internalIp
							internalPortRange {
								from
								to
							}
							remoteIPs {
								ip
								ipRange {
									from
									to
								}
								subnet
								globalIpRange {
									id
									name
								}
							}
							restrictionType
							tracking {
								enabled
								frequency
								subscriptionGroup {
									id
									name
								}
								webhook {
									id
									name
								}
								mailingList {
									id
									name
								}
							}
						}
						properties
					}
					sections {
						audit {
							updatedTime
							updatedBy
						}
						section {
							id
							name
						}
						properties
					}
					audit {
						publishedTime
						publishedBy
					}
					revision {
						id
						name
						description
						changes
						createdTime
						updatedTime
					}
				}
				status
				errors {
					errorMessage
					errorCode
				}
			}
		}
	}	
}
